import React, { Component } from 'react'
import {Table,Button} from 'react-bootstrap'

export default class update extends Component {
  render() {
    return (
      <div>
           <tr >
      <td>{this.props.item.id}</td>
      <td>{this.props.item.name}<br/><br/><Button variant="danger" onClick={this.delete.bind(this,item.id)}>Delete</Button> </td>
      <td><img src={this.props.item.avatar} alt="image" title="Image"/></td>
    </tr>
      </div>
    )
  }
}
